import styled from 'styled-components'
import '../styles/theme.css'

const NavItem = ({className, children}) => (
  <NavItemStyles className={className}>
    {children}
  </NavItemStyles>
);

const NavItemStyles = styled.navitem>`
  display: inline-block;
  border-radius: 3px;
  cursor: pointer;
  font-weight: 500;
  font-size: 0.9em;
  padding: 5px 8px;
    color: var(--white);
    border: 1px solid var(--black);
    border-bottom-width: 3px;
    background: var(--purple200);
  `;

export default NavItem;
